import React,{Component} from 'react';
import '../assets/css/footer.scss';

export default class Footer extends Component{
    home(){
        //this.Props.history.push("/Home")
        this.props.history.push('/path')
        console.log(this)
    };
    follow(){
        //this.context.router.history.push("/Follow")
    }
    render(){

        return(
            <div>
                <div className="footer" onClick={this.home}>
                    <div className="footer-home">
                        <i className="h-icon"></i>
                        首页
                    </div>
                    <div className="footer-list"  onClick={this.follow}>
                        <i className="l-icon"></i>
                        推荐
                    </div>
                    <div className="footer-buy">
                        <i className="b-icon"></i>
                        购物车
                    </div>
                    <div className="footer-my">
                        <i className="m-icon"></i>
                        我的
                    </div>
                </div>
                <div className="footer-null"></div>
            </div>
        )
    }

}
